import React from 'react';
import { Link } from 'react-router-dom';

const Landing = () => {
  return (
    <section className="landing">
      <div className="dark-overlay">
        <div class="d-flex justify-content-center h-100">
          <div class="card-header">
          </div>


        </div>
      </div>
    </section>
  );
};

export default Landing;
